openapi: 3.0.0
info:
  title: ERP Copy
  version: 1.0.0
servers:
  - url: http://{{erpbaseurl}}order
  - url: http://{{erpbaseurl}}stock_deficit
  - url: http://{{erpbaseurl}}stock
  - url: http://{{erpbaseurl}}store
  - url: http://{{erpbaseurl}}supplier
  - url: http://{{erpbaseurl}}fatherorder
  - url: http://{{erpbaseurl}}store_location
  - url: http://{{erpbaseurl}}item_stock_location
  - url: http://{{erpbaseurl}}box
  - url: http://{{erpbaseurl}}order_line_boxes
  - url: http://{{erpbaseurl}}pallet
  - url: http://{{erpbaseurl}}stadistics
  - url: http://localhost:8080
  - url: http://{{erpbaseurl}}login
components:
  securitySchemes:
    bearerAuth:
      type: http
      scheme: bearer
tags:
  - name: order
  - name: order > order lines
  - name: order > order lines > asignation
  - name: stock
  - name: store
  - name: supplier
  - name: Father order
  - name: store locations
  - name: item stock locations
  - name: Box
  - name: Order Lines boxes
  - name: Pallet
  - name: stadistics
paths:
  /orderLines/asignation:
    post:
      tags:
        - order > order lines > asignation
      summary: create
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                Assignations:
                  - line_id: 1252
                    user_id: 1
      security:
        - bearerAuth: []
      responses:
        '202':
          description: Accepted
          headers:
            Content-Type:
              schema:
                type: string
                example: application/json; charset=utf-8
            Date:
              schema:
                type: string
                example: Mon, 28 Apr 2025 09:25:24 GMT
            Content-Length:
              schema:
                type: integer
                example: '44'
          content:
            application/json:
              schema:
                type: object
              example:
                Results:
                  Ok: Asignations are created
    patch:
      tags:
        - order > order lines > asignation
      summary: update
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                Assignations:
                  - id: 1252
                    user_id: 5
      security:
        - bearerAuth: []
      responses:
        '202':
          description: Accepted
          headers:
            Content-Type:
              schema:
                type: string
                example: application/json; charset=utf-8
            Date:
              schema:
                type: string
                example: Mon, 28 Apr 2025 09:25:42 GMT
            Content-Length:
              schema:
                type: integer
                example: '58'
          content:
            application/json:
              schema:
                type: object
              example:
                Results:
                  Errors: null
                  Ok: Asignations are updated
  /orderLines:
    patch:
      tags:
        - order > order lines
      summary: update order lines
      requestBody:
        content:
          application/json:
            schema:
              type: object
              example:
                data:
                  - id: 1
                    quantity: 60
                    recived_quantity: 55
                    box: '1'
                    pallet: '2'
                  - id: 5
                    quantity: 10000
                    recived_quantity: 0
      security:
        - bearerAuth: []
      responses:
        '202':
          description: Accepted
          headers:
            Content-Type:
              schema:
                type: string
                example: application/json; charset=utf-8
            Date:
              schema:
                type: string
                example: Tue, 24 Sep 2024 12:59:49 GMT
            Content-Length:
              schema:
                type: integer
                example: '77'
          content:
            application/json:
              schema:
                type: object
              example:
                Errors: null
                Not_permited_lines_ids: null
                Ok: Orders lines are updated
    get:
      tags:
        - Father order
      summary: get order lines by father order
      security:
        - bearerAuth: []
      parameters:
        - name: page
          in: query
          schema:
            type: integer
          example: '0'
        - name: page_size
          in: query
          schema:
            type: integer
          example: '10'
        - name: father_order_code
          in: query
          schema:
            type: string
          example: OC-2024-12-19 14:06:48
      responses:
        '200':
